import './App.css';

function App() {
  return (
    <div className="App dark:bg-black dark:text-white" >
      <header className="App-header">
        <h1 className="text-3xl">Shaka Clark</h1>
        <p>Social Justice Oriented Software Engineer</p>
        <hr />
      </header>
      <div>
        <p className="p-3">Experience</p>
        <p>MoveOn.org 2017-2019</p>
        <p className="text-sm p-1">Full stack engineer focused on mobile campaigning. Work included being project lead for <a href="https://github.com/moveonorg/spoke">Spoke</a>, an open source peer to peer texting tool.</p>
        <p>UpTogether 2019-2021</p>
        <p className="text-sm p-1">Full stack engineer supporting communities, government agencies and philanthropists to distribute cash transfers and spark social capital exchange.</p>
        <p>The New York Times 2021-present</p>
        <p className="text-sm p-1">Software engineer working on NYT Games including NYT Crossword Puzzle, Spelling Bee, etc.</p>
      </div>
    </div>
  );
}

export default App;
